            font-weight: 400;

        .blob {
            position: absolute;
            border-radius: 50%;
            filter: blur(80px);
            opacity: 0.4;
            z-index: -1;
        }

        .blob-1 {
            width: 300px;
            height: 300px;
            background: linear-gradient(135deg, #c2e9fb, #a1c4fd);
            top: -100px;
            right: -50px;
        }

        .blob-2 {
            width: 250px;
            height: 250px;
            background: linear-gradient(135deg, #e0c3fc, #8ec5fc);
            bottom: -80px;
            left: -50px;
        }

        .container {

            background-color: var(--card-bg);

            backdrop-filter: blur(40px) saturate(180%) brightness(1.1);
            -webkit-backdrop-filter: blur(40px) saturate(180%) brightness(1.1);
            border: 1px solid var(--glass-border-light);

            border-radius: 1.5rem;
            padding: 2.8rem;
            box-shadow: 0 15px 40px var(--shadow-strong), 0 0 0 2px var(--glass-border-light);
            text-align: center;
            color: var(--text-primary);
            max-width: 450px;
            width: 90%;
            position: relative;
            overflow: hidden;
            animation: float 6s ease-in-out infinite;
        }

        .container::before {
            content: '';
            position: absolute;
            top: -50%;
            left: -50%;
            width: 200%;
            height: 200%;
            background: linear-gradient(to bottom right,
                    rgba(255, 255, 255, 0.3) 0%,
                    rgba(255, 255, 255, 0.05) 50%,
                    transparent 100%);
            transform: rotate(-45deg);
            pointer-events: none;
        }

        @keyframes float {
            0% {
                transform: translateY(0px);
            }

            50% {
                transform: translateY(-10px);
            }

            100% {
                transform: translateY(0px);
            }
        }

        h1 {
            font-weight: 600;
            font-size: 1.8rem;
            margin-bottom: 0.8rem;
            color: var(--text-primary);
            text-shadow: 0 0 10px rgba(0, 0, 0, 0.2), 0 0 5px rgba(0, 0, 0, 0.1);
        }

        p {
            font-size: 1.1rem;
            color: var(--text-secondary);
            line-height: 1.5;
            margin-bottom: 1.5rem;
        }


        .loader-container {
            position: relative;
            width: 60px;
            height: 60px;
            margin: 0 auto 2rem;
        }

        .loader {
            position: absolute;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            border-radius: 50%;
            background: linear-gradient(135deg, #0071e3, #40adff);
            opacity: 0.2;
            animation: pulse 2s ease-in-out infinite;
        }

        .loader-inner {
            position: absolute;
            top: 15%;
            left: 15%;
            width: 70%;
            height: 70%;
            border-radius: 50%;
            border: 2px solid rgba(0, 113, 227, 0.3);
            border-top-color: var(--accent);
            animation: spin 1s linear infinite;
        }

        @keyframes pulse {
            0% {
                transform: scale(0.8);
                opacity: 0.2;
            }

            50% {
                transform: scale(1);
                opacity: 0.4;
            }

            100% {
                transform: scale(0.8);
                opacity: 0.2;
            }
        }

        @keyframes spin {
            to {
                transform: rotate(360deg);
            }
        }

        .countdown {
            font-size: 3rem;
            font-weight: 600;
            background: linear-gradient(135deg, #0071e3, #40adff);
            -webkit-background-clip: text;
            -webkit-text-fill-color: transparent;
            background-clip: text;
            margin: 1rem 0;
            text-shadow: 0 2px 10px rgba(0, 113, 227, 0.2);
        }

        a {
            color: var(--accent);
            text-decoration: none;
            transition: all 0.2s;
            font-weight: 500;
        }

        a:hover {
            text-decoration: underline;
        }


        .btn {

            background-color: rgba(255, 255, 255, 0.1);

            backdrop-filter: blur(48px) saturate(200%) brightness(1.12);
            -webkit-backdrop-filter: blur(48px) saturate(200%) brightness(1.12);
            color: var(--text-primary);
            border-radius: 9999px;
            padding: 0.9rem 2.2rem;
            font-weight: 500;
            font-size: 1rem;
            border: 1px solid rgba(255, 255, 255, 0.25);
            box-shadow: 0 5px 15px var(--shadow-medium);
            cursor: pointer;
            margin-top: 1.2rem;
            position: relative;
            overflow: hidden;
            transition: all 0.35s cubic-bezier(0.25, 0.8, 0.25, 1.1);
        }

        .btn::before {
            content: '';
            position: absolute;
            top: -50%;
            left: -50%;
            width: 200%;
            height: 200%;
            background: linear-gradient(to bottom right,
                    rgba(255, 255, 255, 0.3) 0%,
                    rgba(255, 255, 255, 0.05) 50%,
                    transparent 100%);
            transform: rotate(-45deg);
            pointer-events: none;
        }

        .btn:hover {
            transform: translateY(-3px) scale(1.02);
            background-color: rgba(255, 255, 255, 0.15);
            box-shadow: 0 8px 20px var(--shadow-strong), 0 0 18px var(--hover-glow-subtle);
            border-color: rgba(255, 255, 255, 0.35);
        }

        .btn:active {
            transform: translateY(0) scale(0.98);
        }
